export default function Compteur() {
  const [count, setCount] = useState(0);

  function incrementer() {
    setCount(count + 1);
  }

  return (
    <>
      <p>Compteur : {count}</p>
      <button onClick={incrementer}>+1</button>
    </>
  );
}
